function fillFormDispatchReport(){let a=$("#createDispatchReportModal");$.ajax({type:"GET",url:"/report/dailyDispatchReport",data:{name:$("params.name").val(),date:$("params.date").val(),hours:$("params.hours").val(),active_loads:$("params.active_loads").val(),active_drivers:$("params.active_drivers").val(),inactive_drivers:$("params.inactive_drivers").val(),loads_finalized:$("params.loads_finalized").val(),worked_time:$("params.worked_time").val(),dispatch_score:$("params.dispatch_score").val(),score_app_usage:$("params.score_app_usage").val()},success:i=>{const s=a.find("#definidor");s.empty(),s.append(`<div class="form-group"><div class="row"><div class="col-md-3">Dispatch Name:</div> <div class="col-md-3">${i.name}</div><div class="col-md-3">Date:</div><div class="col-md-3">${i.date}</div></div><br><div class="row"><div class="col-md-3">Hours:</div><div class="col-md-3">${i.hours}</div><div class="col-md-3">In Transit:</div><div class="col-md-3">${i.active_loads}</div></div><br><div class="row"><div class="col-md-3">Active Trucks:</div><div class="col-md-3">${i.active_drivers}</div><div class="col-md-3">Inactive Trucks:</div><div class="col-md-3">${i.inactive_drivers}</div></div><br><div class="row"><div class="col-md-3">Time in Dispatch:</div><div class="col-md-3">${msToTime(1e3*i.worked_time*60,!1)}</div><div class="col-md-3">Loads Dispatch:</div><div class="col-md-3">${i.loads_finalized}</div></div><br><div class="row"><div class="col-md-3">Score App Usage</div><div class="col-md-3">${i.score_app_usage}</div><div class="col-md-3">Calification Dispatch</div><div class="col-md-3">${i.dispatch_score}</div></div><br><div for="situationDescription">Situation Description: </div><textarea id="situationDescription" name="situationDescription" rows="4" placeholder="Was there an event?" style="width:100%"></textarea><br><br><div for="situationDescription">Well Status: </div><textarea id="wellStatus" name="wellStatus" rows="4" style="width:100%" placeholder="Describe Well Status:"></textarea></div>`)},error:()=>{throwErrorMsg()}}),$("#createDispatchReportModal").modal("show")}$("#submitDispatchReport").submit((function(a){a.preventDefault();let i=$("#createDispatchReportModal"),s=i.find("textarea").serialize();$.ajax({type:"POST",url:"/report/storeDispatchReport",data:s,success:a=>{throwErrorMsg("Report Generated correctly",{title:"Success!",type:"success"}),$("#createDispatchReportModal").modal("hide"),$.each(i.find("textarea"),(function(a,i){i.value=""}))},error:()=>{throwErrorMsg()}})}));
